rver (DSE 6.0+) to identify the client instance created with this options. When not defined, the driver will generate a random identifier.  @property {String} [applicationName] An optional setting identifying the name of the application using the {@link Client} instance. <p>This value is passed to DSE and is useful as metadata for describing a client connection on the server side.</p>  @property {String} [applicationVersion] An optional setting identifying the version of the application using the {@link Client} instance. <p>This value is passed to DSE and is useful as metadata for describing a client connection on the server side.</p>  @property {Object} [monitorReporting] Options for reporting mechanism from the client to the DSE server, for versions that support it.  @property {Boolean} [monitorReporting.enabled=true] Determines whether the reporting mechanism is enabled. Defaults to <code>true</code>.  @property {Object} [cloud] The options to connect to a cloud instance.  @property {String|URL} cloud.secureConnectBundle Determines the file path for the credentials file bundle.  @property {Number} [refreshSchemaDelay] The default window size in milliseconds used to debounce node list and schema refresh metadata requests. Default: 1000.  @property {Boolean} [isMetadataSyncEnabled] Determines whether client-side schema metadata retrieval and update is enabled. <p>Setting this value to <code>false</code> will cause keyspace information not to be automatically loaded, affecting replica calculation per token in the different keyspaces. When disabling metadata synchronization, use [Metadata.refreshKeyspaces()]{@link module:metadata~Metadata#refreshKeyspaces} to keep keyspace information up to date or token-awareness will not work correctly.</p> Default: <code>true</code>.  @property {Boolean} [prepareOnAllHosts] Determines if the driver should prepare queries on all hosts in the cluster. Default: <code>true</code>.  @property {Boolean} [rePrepareOnUp] Determines if the