y containing amount of connections per host distance.  @property {Number} [pooling.maxRequestsPerConnection] The maximum number of requests per connection. The default value is: <ul> <li>For modern protocol versions (v3 and above): 2048</li> <li>For older protocol versions (v1 and v2): 128</li> </ul>  @property {Boolean} [pooling.warmup] Determines if all connections to hosts in the local datacenter must be opened on connect. Default: true.  @property {Object} [protocolOptions]  @property {Number} [protocolOptions.port] The port to use to connect to the Cassandra host. If not set through this method, the default port (9042) will be used instead.  @property {Number} [protocolOptions.maxSchemaAgreementWaitSeconds] The maximum time in seconds to wait for schema agreement between nodes before returning from a DDL query. Default: 10.  @property {Number} [protocolOptions.maxVersion] When set, it limits the maximum protocol version used to connect to the nodes. Useful for using the driver against a cluster that contains nodes with different major/minor versions of Cassandra.  @property {Boolean} [protocolOptions.noCompact] When set to true, enables the NO_COMPACT startup option. <p> When this option is supplied <code>SELECT</code>, <code>UPDATE</code>, <code>DELETE</code>, and <code>BATCH</code> statements on <code>COMPACT STORAGE</code> tables function in "compatibility" mode which allows seeing these tables as if they were "regular" CQL tables. </p> <p> This option only effects interactions with interactions with tables using <code>COMPACT STORAGE</code> and is only supported by C* 3.0.16+, 3.11.2+, 4.0+ and DSE 6.0+. </p>  @property {Object} [socketOptions]  @property {Number} [socketOptions.connectTimeout] Connection timeout in milliseconds. Default: 5000.  @property {Number} [socketOptions.defunctReadTimeoutThreshold] Determines the amount of requests that simultaneously have to timeout before closing the connection. Default: 64.  @property {Boolean} [socketOptions.keepAlive] Whether to enable TCP keep-alive on the socket. Default: true.  @property {Number} [socketOptions.keepAliveDelay] TCP keep-alive delay in milliseconds. Default: 0.  @property {Number} [socketOptions.readTimeout] Per-host read timeout in milliseconds. <p> Please note that this is not the maximum time a call to {@link Client#execute} may have to wait; this is the maximum time that call will wait for one particular Cassandra host, but other hosts will be tried if one of them timeout. In other words, a {@link Client#execute} call may theoretically wait up to <code>readTimeout * number_of_cassandra_hosts</code> (though the total number of hosts tried for a given query also depends on the LoadBalancingPolicy in use). <p>When setting this value, keep in mind the following:</p> <ul> <li>the timeout settings used on the Cassandra side (*_request_timeout_in_ms in cassandra.yaml) should be taken into account when picking a value for this read timeout. You should pick a value a couple of seconds greater than the Cassandra timeout settings. </li> <li> the read timeout is only approximate and only control the timeout to one Cassandra host, not the full query. </li> </ul> Setting a value of 0 disables read timeouts. Default: <code>12000</code>.  @property {Boolean} [socketOptions.tcpNoDelay] When set to true, it disables the Nagle algorithm. Default: true.  @property {Number} [socketOptions.coalescingThreshold] Buffer length in bytes use by the write queue before flushing the frames. Default: 8000.  @property {AuthProvider} [authProvider] Provider to be used to authenticate to an auth-enabled cluster.  @property {RequestTracker} [requestTracker] The instance of RequestTracker used to monitor or log requests executed with this instance.  @property {Object} [sslOptions] Client-to-node ssl options. When set the driver will use the secure layer. You can specify cert, ca, ... options named after the Node.js <code>tls.connect()</code> options. <p> It uses the same default value