es.  @property {Boolean} [encoding.useBigIntAsVarint] Use [BigInt ECMAScript type](https://tc39.github.io/proposal-bigint/) to represent CQL varint data type.  @property {Array.<ExecutionProfile>} [profiles] The array of [execution profiles]{@link ExecutionProfile}.  @property {Function} [promiseFactory] Function to be used to create a <code>Promise</code> from a callback-style function. <p> Promise libraries often provide different methods to create a promise. For example, you can use Bluebird's <code>Promise.fromCallback()</code> method. </p> <p> By default, the driver will use the [Promise constructor]{@link https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Global_Objects/Promise}. </p>
